const uploadInput = document.getElementById('upload-image');
const searchText = document.getElementById('search-text');
const searchButton = document.getElementById('search-button');
const results = document.getElementById('results');

const templateImageUrl = 'data:image/png;base64,';

const tabButtons = document.querySelectorAll('.tab-button');
const tabContents = document.querySelectorAll('.tab-content');

tabButtons.forEach((button) => {
  button.addEventListener('click', () => {
    const targetId = button.dataset.target;
    const targetContent = document.getElementById(targetId);

    tabButtons.forEach((btn) => btn.classList.remove('active'));
    tabContents.forEach((content) => content.classList.remove('active'));

    button.classList.add('active');
    targetContent.classList.add('active');
  });
});

uploadInput.addEventListener('change', async () => {
  const file = uploadInput.files[0];
  if (file && file.size <= 5 * 1024 * 1024) {
    const image = new Image();
    image.src = URL.createObjectURL(file);
    image.onload = async () => {
      const outputImage = await combineImages(image);
      displayImage(outputImage, file.name.replace(/\.[^/.]+$/, ''));
    };
  } else {
    alert('Please upload an image smaller than 5MB.');
  }
    uploadInput.value = ''; // Reset the input to allow selecting the same file again.
});

async function searchImages(query, apiKey, cx, num, imageSize) {
  const url = `https://www.googleapis.com/customsearch/v1?key=${apiKey}&cx=${cx}&q=${query}&searchType=image&num=${num}`;
  const corsProxy = 'https://corsproxy.io/?';
  const headers = {
    'Origin': 'https://example.com',
  };
  
  const config = {
    headers: headers
  };
  
  try {
    console.log('Fetching images...');
    //const response = await axios.get(url, config);
    const response = await axios.get(url);
    console.log('Images fetched successfully.');
    const items = response.data.items;
    if (items && items.length > 0) {
      const images = items.map((item) => {
        const image = new Image();
        image.crossOrigin = 'anonymous';
        if (imageSize === 'thumbnail') {
          image.src = item.image.thumbnailLink;
        } else {
          //image.src = corsProxy + encodeURIComponent(item.link);
          image.src = item.link;
        }
        return image;
      });

      await Promise.all(images.map((image) => new Promise((resolve) => (image.onload = resolve))));
      return images;
    } else {
      alert('Sorry, no images were found for your search query.');
    }
  } catch (error) {
    if (error.response && error.response.status === 400) {
      alert('Invalid request. Please check your API key and CX.');
      throw new Error('Invalid request. Please check your API key and CX.');
    } else if (error.message.includes('CORS')) {
      throw new Error('The server does not allow cross-origin requests. Please try again later.');
    } else {
      console.error('Error fetching images:', error);
      throw new Error('An unknown error occurred. Please try again later.');
    }
  }
}



  function createImageElement(image, name) {
    const container = document.createElement('div');
    container.classList.add('result-image-container');
  
    const img = new Image();
    img.classList.add('result-image');
    img.src = image.src;
    img.addEventListener('click', () => {
      processSelectedImage(image, name);
    });
  
    container.appendChild(img);
    return container;
  }

  function processSelectedImage(image, name) {
    const link = document.createElement('a');
    link.href = image.src;
    link.download = `old-man-yells-at-${name.replace(/\s/g, '-')}.png`;
    document.body.appendChild(link);
    link.click();
    document.body.removeChild(link);
  }
  


  async function compressImage(canvas) {
    let quality = 1;
    let compressedDataURL = canvas.toDataURL();
  
    // Check the original image type and update the MIME type accordingly
    const originalMimeType = compressedDataURL.split(',')[0].split(':')[1].split(';')[0];
    const compressedMimeType = `image/${originalMimeType === 'gif' ? 'gif' : 'png'}`;
  
    let newWidth = canvas.width;
    let newHeight = canvas.height;
  
    while (compressedDataURL.length > 125 * 1024) {
      quality -= 0.1;
      if (quality < 0) {
        quality = 1;
        newWidth = Math.floor(newWidth * 0.9);
        newHeight = Math.floor(newHeight * 0.9);
  
        const tempCanvas = document.createElement('canvas');
        const tempCtx = tempCanvas.getContext('2d');
        tempCanvas.width = newWidth;
        tempCanvas.height = newHeight;
        tempCtx.drawImage(canvas, 0, 0, newWidth, newHeight);
        compressedDataURL = tempCanvas.toDataURL(compressedMimeType, quality);
  
        if (newWidth < 100 || newHeight < 100) {
          alert('Unable to compress image below 125KB');
          throw new Error('Unable to compress image below 125KB');
        }
      } else {
        compressedDataURL = canvas.toDataURL(compressedMimeType, quality);
      }
    }
  
    const compressedImage = new Image();
    compressedImage.src = compressedDataURL;
    await new Promise((resolve) => (compressedImage.onload = resolve));
  
    return compressedImage;
  }
  

  async function combineImages(image) {
    const canvas = document.createElement('canvas');
    const ctx = canvas.getContext('2d');
    canvas.width = 500;
    canvas.height = 500;

    const template = new Image();
    if (templateImageUrl.startsWith('data:image/')) {
        template.src = templateImageUrl;
    } else {
        template.crossOrigin = 'anonymous';
        template.src = templateImageUrl;
    }
    await new Promise(resolve => (template.onload = resolve));

    const resizedImage = resizeImage(image);
    await new Promise(resolve => (resizedImage.onload = resolve));

    ctx.drawImage(resizedImage, 0, 0);
    ctx.drawImage(template, 0, 0, 500, 500);

    const outputImage = await compressImage(canvas);

    return outputImage;
}

function resizeImage(image) {
    const canvas = document.createElement('canvas');
    const ctx = canvas.getContext('2d');

    const isPortrait = image.width < image.height;
    const scaleFactor = isPortrait ? 245 / image.width : 245 / image.height;
    const newWidth = image.width * scaleFactor;
    const newHeight = image.height * scaleFactor;

    canvas.width = newWidth;
    canvas.height = newHeight;

    ctx.drawImage(image, 0, 0, newWidth, newHeight);

    const resizedImage = new Image();
    resizedImage.src = canvas.toDataURL();
    return resizedImage;
}

function displayImage(image, name) {
  const imageElement = createImageElement(image, name);
  results.appendChild(imageElement);
}


searchButton.addEventListener('click', async () => {
  // Disable the search button
  searchButton.disabled = true;

  const query = searchText.value.trim();
  const apiKey = document.getElementById('apiKey').value;
  const cx = document.getElementById('cx').value;
  const num = document.getElementById('num-results').value;
  const imageSize = document.querySelector('input[name="image-size"]:checked').value;

  // Check if all required fields are filled in
  const allFieldsFilled = query && apiKey && cx && num;

  if (allFieldsFilled) {
    try {
      const images = await searchImages(query, apiKey, cx, num, imageSize);
      if (images.length > 0) {
        for (const image of images) {
          const outputImage = await combineImages(image);
          displayImage(outputImage, query);
        }
      } else {
        // Display an error message to the user
        alert('Sorry, no images were found for your search query.');
      }
    } catch (error) {
      console.error('Error fetching images:', error);
      // Display an error message to the user
      //alert('Sorry, we could not fetch the images. Probably the API key or CX is invalid.' +  error);
    }
  } else {
    // Highlight the empty fields
    const requiredFields = [searchText, document.getElementById('apiKey'), document.getElementById('cx'), document.getElementById('num-results')];
    requiredFields.forEach((field) => {
      if (!field.value.trim()) {
        field.setCustomValidity('This field is required.');
      } else {
        field.setCustomValidity('');
      }
    });
  }

  // Re-enable the search button after 1 second
  setTimeout(() => {
    searchButton.disabled = false;
  }, 1000);
});